  Code = "class Solution:\n    def cellsInRange(self, s: str) -> List[str]:\n        cell1, cell2 = s.split(\":\")\n        row1, col1 = cell1[0], int(cell1[1:])\n        row2, col2 = cell2[0], int(cell2[1:])\n        res = []\n        while row1 <= row2:\n            for col in range(col1, col2 + 1):\n                res.append(f\"{row1}{col}\")\n            row1 = chr(ord(row1) + 1)\n        return res"
